import { Container, Row, Col } from 'react-bootstrap';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import MailIcon from '@mui/icons-material/Mail';
import FacebookIcon from '@mui/icons-material/Facebook';
import SportsVolleyballIcon from '@mui/icons-material/SportsVolleyball';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <footer className="bg-dark text-white py-5">
      <Container>
        <Row>
          <Col>
            <h5>GET IN TOUCH</h5>
            <p>t is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>
            <div className='icon-size'>
              <InstagramIcon />
              <LinkedInIcon />
              <MailIcon />
              <FacebookIcon />
            </div>

          </Col>
          <Col className='footer-right-box d-inline-flex '>
            <div>
              <SportsVolleyballIcon />
          <Link to='https://www.google.com' target='blank'>www.google.com</Link>
            </div>
            <div  >
              <SportsVolleyballIcon />
          <Link to='https://www.google.com' target='blank'>www.google.com</Link>
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
